"description": "This classic gun metal fountain pen makes a truly elegant writing instrument. It offers superior writing characteristics of the fountain style with a cap that posts to the end. Plus, the gun metal plating will give your pen a rich and luxurious look. Built for beauty and durability, this pen includes a balanced style and design.\n\nThis pen will make a special gift for Whiskey lovers. The pen blank was made from an authentic Jack Daniels charred Tiger Oak whiskey barrels used for aging Old No. 7 whiskey. The whiskey is aged in these barrels for 4 years. The used barrels are salvaged, the steel bands are removed, and the staves disassembled. Finally, the staves are cut into over-sized (7/8in. x 7/8in. x 5-1/4in. minimum) pen blanks. The pen comes with its own certificate of authenticity. \n\nEach of our pens go through the process of cutting, turning, and sanding on the lathe, and are finished with a high quality friction polish that will keep them looking great for years.\n\n_________________________________________\n\nCustom Orders:\nIf you&#39;d like to order a variation of this pen with different wood or fittings, please request a custom order from our store. We can also custom make almost any style of pen with almost any variation of wood/fittings that come up with!\n\nThanks for looking~!",
