"description": "Set of 3 laser engraved whiskey stones. The perfect addition to our groomsmen gift boxes and liquor flask sets. Whiskey stones are perfect for the connoisseur who enjoys their beverage with a slight chill, but doesn’t want to water down the perfect balance of flavors in their drink. Stones are laser engraved on a single side with your choice of personalization. Each set of 3 comes in it&#39;s very own muslin storage bag.\r\n\r\nUse to chill your whiskey, scotch, vodka, wine, etc.\r\n\r\nThis listing is for a set of three (3) laser engraved whiskey stones.\r\nStones are made from 100% pure Soapstone. Each stone measures 7/8”cubed.\r\n\r\nSoapstone has superior thermal mass giving it the natural ability to retain its’ temperature for extended periods of time. Soapstone is non-porous, odorless, and tasteless.  It will not absorb odors from your freezer like ice cubes do. Edges are rounded and soapstone is softer than glass so they will not damage barware. These stones are dishwasher safe and will never wear out.\r\n\r\nNeed a different quantity or a custom image or logo? I love custom orders ..\r\nJust send me a message and I&#39;ll get a RESERVED order set right up for you!",
