"description": "This is a soap/lotion dispenser of the top selling Canadian whisky in the U.S.\n\nHere is a recycled/re-purposed Crown Roayl 750ml bottle outfitted with an all-metal soap/lotion pump that is perfect for your kitchen, bathroom, bar or laundry room.  The dispenser fits perfectly on the bottle.  The tube length has been cut to fit this bottle (omitted from the photographs to show the details of the glass.)  The pump head has a stainless steel internal spring and glass ball for durability.\n\nThe complete assembly measures 9 11/16&quot; x 3&quot; x 5 5/8&quot; (24.6cm x 7.6cm x 14.3cm)\n\nPlease note:  This listing is for the bottle and one metal soap dispenser in your choice of finishes.  Please select from one of the pump heads in the last photograph:\n\n1.  Stainless steel\n2.  Satin Copper\n3.  Chrome\n\nAlso, please select whether &quot;With&quot; or &quot;Without Label&quot; as I have one of each.\n\nSoap/lotion/body wash not included.\n\nMy stock of bottles is constantly rotating.  Please contact me if you would like multiples of this item (who doesn&#39;t have lotion, dish soap, hand soap and body wash around, right?)  I&#39;ll keep an eye out for others and let you know when I have additional bottles.\n\nPlease be sure to check out my other Doodads (many of which include re-purposing bottles into Porch Torches, patio and pendant lights.)  I have reduced shipping as much as possible when you order multiple items.\n\nThanks for looking at my stuff!\n\nOther unique items can be found at: https://www.etsy.com/shop/davesdoodads\n\nThe unique re-purposed items sold by Dave&#39;s Doodads are not sponsored or endorsed by the brewers/distillers/wineries/meaderies/cideries.  I do this out of love.",
