"title": "Antique 1878 Blake MOONSHINE Whiskey STILL Liquor License Bar 100.00 Brewer Distillery Civil War Keg Barrel Tax NY Speakeasy New York Form",
"description": "An original ornate document dated 1878 for the Business of Wholesale Liquor Dealer issued by the US Internal Revenue...&quot;Severe Penalties are imposed for neglect or refusal to place and keep this stamp conspicuously in your establishment or place of business&quot;! This document was stamped by the District Collector, M. B. Blake, of New York.  Please see photos!\n\nThis document has beautiful graphics, engraved on the top center is the Greek God, Mercury, with the medical symbol (snake & staff) in hand, leaning on a large woven wicker, glass bottle, sitting next to wooden kegs, a moonshine still, along with a funnel lying on the ground!\n\nThe government used this stamp as a tax for selling, dispensing and distilling liquor to raise money to pay for the Civil War. In fine print on the bottom is: &quot;Bureau Engraving & Printing&quot;, &quot;$100 Dollars Per Year&quot; near the bottom, and &quot;Stamp For Special Tax&quot;, near the top, When held to the light the watermark, USIR, is visible.\n\nThe front measures 8&quot; by 7&quot;, the coupons are folded behind, so actual length is 14&quot;. The document has only one hole punch (to void), two tack holes, a few small, light spots and light edge wear, otherwise, condition is excellent...a beautiful document...great in person!\n\nThis is a FANTASTIC piece of history and would be wonderful to display in a pharmacy, doctor&#39;s office, museum, bar or office! I am happy to answer any questions, please feel free to email and thank you for your interest!",
