"description": "Irish beard balm is a special blend of Coconut oil, Sweet almond oil, Jojoba oil, Argan oil, Hemp oil, and Bees wax.\n\nAll products that go into Irish beard balm are made with natural ingredients that are GMO free.  I use no chemicals or preservatives in my product. To see my organic certifications please go to https://www.irishbeardbalm.com/products.html\n\nYou may have noticed that unlike every other beard balm on the market, I do not use coco or shea butter. These butters are normally used to thicken balms but they also leave your beard feeling heavy and they can build up over time. After extensive trial and error, I found a way to make a balm that does not use any butters which leaves my beard feeling light.\n\nAs you can see, the price of this particular balm is quite higher than the others, this is because of the higher cost of the fragrance that I use to make Whiskey Barrel. Unlike my other balm fragrances that utilize an essential oil, this balm uses a much thicker much more potent essential oil paste. This fragrance is definitely much stronger than the others and it last longer through the day. Whiskey barrel, like it&#39;s name implies, has a strong earthy, woody scent. Having smelled the inside of a spent oak whiskey barrel, I can say that is what this smell like. \n\nPlease check out my other listings. I carry a full line of mens combs, ladies brushes, beard oil and an all natural lip balm.\n\nRemember as with any new product, test on a small insensitive part of your body to gauge for any adverse reactions.",
