"policy_welcome": "Welcome & Thank you for visiting GK Apparel!\r\n***Be sure to add on a few Extra Days to shipping due to it being Easter this Month and we will be out of town from Friday April 3rd until Monday April 6th to be with our Family!***\r\n\r\nPLEASE KNOW~Every time you make a purchase we are both very grateful! We are always excited to get that certian notification! \r\nWe always love seeing people wearing their shirts shared with us via facebook & instragram! & we are even more thrilled to see all of your awesome reviews {Don&#39;t forget those!;)}. \r\n\r\nThank you, Thank you!\r\nGK Apparel",
"policy_payment": "Credit Cards & Paypal are accepted!\r\n{Live in Cedar City, Utah & want to pay with Cash? That is just fine, simply shoot us a message and we&#39;ll discuss the details!}",
"policy_shipping": "We typically ship any order approximately 3-7 business days after your order has been placed {BUT,BE AWARE Exceptions will apply for some Weekends & ESPECIALLY Holidays}. \r\n\r\nGenerally the US Postal Service will add a additional 2-5 Days for delivery. \r\nThey&#39;ve  been known to even deliver the following bushiness day for in State addresses{Utah}!\r\nExpect your order within 10 days or sooner. Options for Rush Orders are available. Message us for options & extra pricing.\r\n\r\nEver order is shipped with a tracking number on each shipping label that is processed through Etsy. This protects us and you. We mark our items as shipped the same day the order is processed through the US Postal Service. A email notification will also be sent to you with the tracking number!  \r\n\r\n{Live in Cedar City & want to escape Shipping Charges? We&#39;d LOVE to help with that by having you use the coupon code: CEDARCITYSHIPPING at checkout. Then, in the note section please leave a phone number we can contact you at for delivery/pickup! }.",
"policy_refunds": "All of our items are Made To Order:)\r\nAll personalized & customized items are Non-Refundable & Non-Exchangeable. \r\nHoliday Items are Non-Refundable & Non-Exchangeable. \r\n\r\nRefunds and exchanges are ONLY offered for items that were accidentally damaged by GKApparel. \r\nIf you have found a issue with your order that you would like to discuss PLEASE feel free to contact us via messaging or email{Shirtznmore@Gmail.com}. \r\nWe&#39;d like to help our customers as much as possible .",
"policy_additional": "FREQUENTLY ASKED QUESTIONS\r\n\r\nSIZING QUESTIONS\r\nORDER CHANGING QUESTIONS\r\n\r\n\r\nCustomizing/Personalizing Shirts\r\nJust because its not listed as a option(such as Tshirt/Vinyl Coloring) doesn&#39;t mean its not possible!  Wording & Coloring can always be changed! Personalize with any name on ANY shirt! We just need your instructions when you checkout in the message/note box! \r\n\r\nCustom Order Proofing\r\n\r\n\r\n\r\n",
