"description": "Personalized Engraved Whiskey Barrel / Whiskey Keg Handcrafted from American White Oak and Personalized just for YOU. pr.\n\nGive a special gift to your groomsmen or bridesmaids that is both personalized and fun!\n\nAdd the special name of the recipient and his or her monogram on each Personalized Whiskey Barrel . Each Personalized Whiskey Barrel is a fun way to express your gratitude and last as a reminder of your special day. It&#39;s a great gift that they&#39;ll use for years. \n\nWIth your choice of BLACK or GALVANIZED steel hoops,  our  toasted Whiskey Barrels are perfect for aging spirits in small 2 liter batches.  Discover oak barrel-aged  Wine, Beer, Tequila, Brandy, Whiskey, Scotch, Bourbon, Rum, Cognac or any spirit. \n\nPair each personalized Personalized Whiskey Barrel with our rocks glass set or our matching personalized whiskey decanter.\n\n~~~~~~~~~~~~~\nAt checkout, please include the following for the personalization for your barrel:\nWhiskey name (Forty-Something is shown)\nDistillery name (last name of recipient)\nDistillery location (hometown of recipient)\nEstablished Year\n\n~~~~~~~~~~~~~\n\n\n\n2 Liter  (2.11 quarts) \nHeight 7 1/2 “\nDiameter of Head  5 1/4 “ \nDiameter of Bilge/Belly 6 1/4 “ \n\n\nEach Personalized Whiskey Barrel comes complete with its own stand, bung and spigot.\n\nOur laser engraved Personalized Whiskey Barrel are the perfect gift and make a fun wedding favor and keepsake. Also a great gift for a birthday, Anniversary, Retirement, Achievement, Father&#39;s Day, Thank You, and more. \t\n\n\nWeddings personalized gifts whiskey barrel groomsmen gift groomsmen gifts fathers day gift wedding party giftwedding party gifts best man gifts best man gift custom best man gift wedding gift groomsman gift barrel",
