"title": "The Dylan Tee - Unisex - PRE ORDER",
"description": "This baby is part of our Music Muse series, inspired by musicians and bands who fill our hearts and lives with tunes that move us.  This series will constantly be growing as time goes on...\n\n\nABOUT THE SHIRT:\nPrinted on super soft heathered tees, they are perfect for lounging around the house all day, or outfitting with your favorite flannel and skirt for a day out.  In our minds, a good tee is the perfect base for any outfit.\n\nThe fit of these runs about a size small in the women&#39;s style, so size up if you don&#39;t want it to fit you too tight.  If your unsure, grab your favorite fitting tee and compare the measurements with the size chart below.  Weve included both the women&#39;s and unisex for size comparisons.  The biggest difference in style between these is that the women&#39;s neckline scoops a bit lower and they are more fitted, where as the unisex ones are a bit longer, more boxy and have a higher neckline (and of course are more true to men&#39;s sizing).  But they both are made from super soft heathered material that just feels so good on!  All inks used are eco-friendly water based inks.\n\n**Size note: Model is wearing the women&#39;s size medium, and is 5&#39;2&quot; and 115 lbs.**\n**Material is: Tri-Blend (50% Polyester / 25% Ring-Spun Cotton / 25% Rayon) **\n**Color is heather tri-coffee (sort of a light brown)**\n\n\nSHIPPING DATES // PLEASE READ:\n\nMost of our shirts are PRE-ORDER only, meaning they are not ready to ship.  They take 6-7 weeks before they are shipped off to you, although we do strive to send them out quicker if we can.  You can always refer to your invoice to see when your estimated shipping date is.  Although we do try out best to get them out quicker we cannot guarantee it.  Please only order if you are okay with this wait.\n\n**A little extra info explaining the pre-order time length: Skyline Fever is currently our second job.  James works a full-time day job, while Laura runs her own full-time business.  We hope that one day we can call Skyline Fever James full time job, so every pre-order gets us one step closer to being able to provide quicker turn around times!  Until then, we will do our best to get out each order as quickly as possible while creating them during our evenings and weekends.  We really can&#39;t thank everyone enough for always being so patient and loving our work enough to wait that long, it means the world to us!**\n\n\nSIZE CHART:\nWomen&#39;s Small //  Size 0-2 // Chest Width 16-7/8&quot; // Front Body Length 25-7/8&quot;\nWomen&#39;s Medium //  Size 4-6 // Chest Width 17-3/8&quot; // Front Body Length 26-1/2&quot;\nWomen&#39;s Large // Size 8-10 // Chest Width 17-7/8&quot; // Front Body Length 27-1/8&quot;\nWomen&#39;s XL // Size 12-14 // Chest Width 18-3/8&quot; // Front Body Length 27-3/4&quot;\n\nUnisex Extra Small // Chest Width 15-3/8&quot; // Front Body Length 27-3/4&quot;\nUnisex Small // Chest Width 17-3/8&quot; // Front Body Length 28-3/4&quot;\nUnisex Medium // Chest Width 19-3/8&quot; // Front Body Length 29-3/4&quot;\nUnisex Large // Chest Width 21-3/8&quot; // Front Body Length 30-3/4&quot;\nUnisex XL // Chest Width 23-3/8&quot; // Front Body Length 31-3/4&quot;\nUnisex 2XL // Chest Width 25-3/8&quot; // Front Body Length 32-3/4&quot;\n\n\nCOPYRIGHT: Please note that all of our designs are copyrighted and my not in any way be recreated.",
