"title": "Cobalt Wooden Ring Lined with Whiskey Barrel White Oak Barrel",
"description": "The inner liner of this Cobalt ring is made from a genuine used Jack Daniels Whiskey white oak barrel. Almost as much work goes into perfecting a bourbon barrel as does perfecting the iconic American whiskey. Carefully selected American White Oak is slowly dried outdoors for nearly a year. After being exposed to the rain and sun, it is kiln dried, assembled, and then charred to release the naturally occurring flavors that will be imparted to the whiskey. Though the blanks reek of whiskey, the final products (sadly, from an authenticity perspective) have no odor, having been sealed with finish.\n\nI have a few other barrel wood options besides Jack Daniels®, including Jim Beam, Maker&#39;s Mark, and Buffalo Trace. For this ring, I would be willing to use the rare stock I have from The Macallan.  Please see this blog post to see what I mean:\n\nhttp://www.wedgewoodrings.com/blog/2014/4/27/barrel-staves-and-the-many-options-at-our-disposal\n\nJACK DANIEL&#39;S is a registered trademark and is not involved in or affiliated with the production or distribution of this product!\n\n\nThe outer portion of this ring is made of Cobalt - the most scratch resistant and shatterproof material I offer.  Like titanium it is hypoallergenic and biocompatible.  However, in many circumstances under which your Titanium ring might scratch, Cobalt will not.   It is an alloy that is identical to Platinum in color, but it is an order of magnitude stronger.  Cobalt offers nearly the scratch resistance of Tungsten Carbide, but unlike Tungsten, Cobalt will not shatter if dropped. \n\nThe ring pictured is a satin finish, but a polished finishes is also available. The ring is also a domed profile (vs. a flat profile), which can also be changed. Just add the details you like in the &quot;message to seller&quot; section at checkout. \n\nThis is the first Cobalt ring with a wood interior ever offered.\n\nI highly recommend going to a jewelry counter to determine your size, even if you already know your size. &quot;Do it yourself&quot; ring sizing methods (string, etc.) should absolutely not be trusted. Be sure to be measured using the width you plan to order.\n\n+++SEE SHOP ANNOUNCEMENTS ON THE SHOP PAGE FOR CURRENT SHIP DATE+++\n\nNOTE ON WIDTH:\n\nThe minimum width for this style is 5mm.  The maximum is 8mm.\n\nRecommended width is calculated in this way: Size 5 is 5mm wide. Width increases .5mm per size above that. So:\n\nSize 5- 5mm\nSize 6- 5.5mm\nSize 7- 6mm\nSize 8- 6.5mm\nSize 9- 7mm\nSize 10- 7.5mm\nSize 11+ - 8mm\n\n\n************************************ IMPORTANT INFO ****************************************\n\n****************************************************************************************************\n****PLEASE PLEASE PLEASE BE 100% SURE OF YOUR SIZE BEFORE ORDERING *****\n****************************************************************************************************\n\nCobalt lined wood rings can be adjusted up or down about 1/4 size (by removing or adding finish to the interior). Every ring is made to the exact size provided. An error in sizing that exceeds the margin provided above will necessitate a completely new ring. REFUNDS AND EXCHANGES WILL NOT BE POSSIBLE. BE 100% SURE OF YOUR ACCURATE AND CORRECT SIZE BEFORE ORDERING.\n\nPlease click on the &quot;Policies&quot; link (under Shop Info) to see wood ring care instructions and FAQ.\n\nEach ring is given multiple coats of a hybrid epoxy finish, which is completely water-proof and soap proof. This protective coating is sanded up to 12,000 grit for an unbelievable, glass-like finish.\n\nAll rings ship via USPS Priority (or Priority International) Small Flat Rate Box. If you are outside the US and Canada, your shipping option is Global Express by default.  Please read below for details.  Insurance is mandatory for this ring, and included in the shipping charge. You pay what I pay for shipping, nothing more.\n\nFor customers outside the US:\n\nDue to changes in USPS policy, international packages sent to countries other than Canada can no longer be tracked past the US border.  Insurance claims are also not possible.  Due to this change and for your protection, international customers outside of Canada will be required to pay for USPS Global Express shipping ($44.95), which in addition to guaranteeing arrival within 3-5 business days (excepting intervention from your country’s customs department), also can be tracked and insured.  I wish I could offer a more economical solution, but cheaper options are too risky.\n\nInternational customers are responsible for all fees associated with shipping to their respective countries. Orders that are shipped to countries outside of the United States may be subject to import taxes, customs duties and fees levied by the destination country. The recipient of an international shipment may be subject to such import taxes, customs duties and fees, which are levied once a shipment reaches your country. Additional charges for customs clearance must be borne by the recipient; I have no control over these charges and cannot predict what they may be. Customs policies vary widely from country to country; you should contact your local customs office for further information. When customs clearance procedures are required, it can cause delays beyond the original delivery estimates. It is against the law and I will not mark an item as a &quot;gift&quot; to avoid any fees.",
